import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import LoginPage from './pages/token';

function App() {
  return (
    <Router>

        <Route path="/login">
          <LoginPage />
        </Route>
    </Router>
  );
}

export default App;
